const Cormorant300 = `@font-face { font-family: 'Cormorant'; font-style: normal; font-weight: 300; src: local('Cormorant Light'), local('Cormorant-Light'), url('data:font/woff2;base64,') format('woff2'); }`;
const Cormorant300italic = `@font-face { font-family: 'Cormorant'; font-style: italic; font-weight: 300; src: local('Cormorant Light Italic'), local('Cormorant-LightItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const CormorantRegular = `@font-face { font-family: 'Cormorant'; font-style: normal; font-weight: 400; src: local('Cormorant Regular'), local('Cormorant-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const CormorantItalic = `@font-face { font-family: 'Cormorant'; font-style: italic; font-weight: 400; src: local('Cormorant Italic'), local('Cormorant-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Cormorant500 = `@font-face { font-family: 'Cormorant'; font-style: normal; font-weight: 500; src: local('Cormorant Medium'), local('Cormorant-Medium'), url('data:font/woff2;base64,') format('woff2'); }`;
const Cormorant500italic = `@font-face { font-family: 'Cormorant'; font-style: italic; font-weight: 500; src: local('Cormorant Medium Italic'), local('Cormorant-MediumItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Cormorant600 = `@font-face { font-family: 'Cormorant'; font-style: normal; font-weight: 600; src: local('Cormorant SemiBold'), local('Cormorant-SemiBold'), url('data:font/woff2;base64,') format('woff2'); }`;
const Cormorant600italic = `@font-face { font-family: 'Cormorant'; font-style: italic; font-weight: 600; src: local('Cormorant SemiBold Italic'), local('Cormorant-SemiBoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Cormorant700 = `@font-face { font-family: 'Cormorant'; font-style: normal; font-weight: 700; src: local('Cormorant Bold'), local('Cormorant-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const Cormorant700italic = `@font-face { font-family: 'Cormorant'; font-style: italic; font-weight: 700; src: local('Cormorant Bold Italic'), local('Cormorant-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
